const dataProvider = jsonServerProvider('https://jsonplaceholder.typicode.com');

//resource component tell react-Admin that we 
function App() {
   return (
       <Admin dataProvider={dataProvider}>
           <Resource name="users" list={ListGuesser}/>

       </Admin>
   );
}

export default App;
